import React from "react";
import './Prototyping.css';
import "@fontsource/red-hat-display";

import contentIcon from './resources/uiux-background.svg';

import './../min.css';
function OurService(){
    return(
        <div className="body-prototype-service">
            <h3 className="our-service-text" style={{'text-align':'center'}}>Our Service</h3>
            <div className="row">
                <div className="box-prototyping"><img src={contentIcon} style={{width:'100%'}}/><p className="service-specific-text-prototyping">UI & UX Design</p></div>
                <div className="box-prototyping"><img src={contentIcon} style={{width:'100%'}}/><p className="service-specific-text-prototypingt">UX Audit</p></div>
                <div className="box-prototyping"><img src={contentIcon} style={{width:'100%'}}/><p className="service-specific-text-prototyping">Brand Identity Design</p></div>
           </div>
        </div>

    );
}
export default OurService;
